import React from 'react';



function Hello({color, name}){

    const style = {
        backgroundColor: 'black',
        color: 'aqua',
        fontSize: 24,
        padding: '1rem'
    }
    return (
        <>
            <div style={{color}}>안녕하세요 {name}</div>
            <div style={style}>{name}</div>
        </>
    )

}

export default Hello;
